export const Social = () => {
    return (
        <div className="home__social">
            <a href="https://github.com/DayaneAlRodrigues" className="home__social_icon" target="__blank">
            <i class="uil uil-github-alt"></i>
            </a>
            <a href="https://www.linkedin.com/in/dayane-de-almeida-rodrigues-067063219/" className="home__social_icon" target="__blank">
            <i class="uil uil-linkedin-alt"></i>
            </a>


        </div>
    )
}
